      {/* Features Section */}
      <section className="w-full py-16 md:py-24 lg:py-18 bg-muted/50">
        <div className="container mx-auto px-4 md:px-6">
          <div className="mx-auto flex max-w-[58rem] flex-col items-center space-y-8 text-center mb-12">
            <h2 className="font-heading text-3xl leading-[1.1] sm:text-4xl md:text-5xl lg:text-6xl">
              Why Use RunMat?
            </h2>
        </div>
          <div className="mx-auto grid justify-center gap-4 sm:grid-cols-2 lg:grid-cols-4 md:max-w-[80rem]">
            <Card>
              <CardHeader className="items-center text-center">
                <div className="mb-3 text-3xl">âœ…</div>
                <CardTitle>Full MATLAB  Language Semantics</CardTitle>
              </CardHeader>
              <CardContent>
                <CardDescription className="text-center">
                  Run the whole language, not a subset:  proper indexing (<code>end</code>/colon/masks), multiple returns,
                  classdef OOP, events/handlesâ€”plus built-ins across arrays, linalg, FFT/signal, stats, strings, and I/O. See <Link className="underline" href="/docs/language-coverage">coverage</Link>.
                </CardDescription>
              </CardContent>
            </Card>
            <Card>
              <CardHeader className="items-center text-center">
                <div className="mb-3 text-3xl">âš¡</div>
                <CardTitle>Faster by Design (Fusion + Residency)                </CardTitle>
              </CardHeader>
              <CardContent>
                <CardDescription className="text-center">
                RunMat collapses back-to-back math into fewer GPU steps and keeps arrays on device, cutting memory traffic so scripts finish sooner. 
          

          See <Link className="underline" href="/docs/how-it-works">how it works</Link>.
                </CardDescription>
              </CardContent>
            </Card>
            <Card>
              <CardHeader className="items-center text-center">
                <div className="mb-3 text-3xl">ðŸ“¦</div>
                <CardTitle>Slim Core + Packages + IDE LSP</CardTitle>
              </CardHeader>
              <CardContent>
                <CardDescription className="text-center">
                Single compact binary with a modern package system. Install native Rust or source MATLAB-style packages. First-class Language Server for VS Code/Cursor with hovers, errors, and go-to-docs.  See the <Link className="underline" href="/docs/package-manager">package manager</Link>.
                </CardDescription>
              </CardContent>
            </Card>
            <Card>
              <CardHeader className="items-center text-center">
                <div className="mb-3 text-3xl">ðŸ§±</div>
                <CardTitle>Portable + Lightweight</CardTitle>
              </CardHeader>
              <CardContent>
                <CardDescription className="text-center">
                Same code, everywhere: static binaries with consistent performance on macOS/Windows/Linux and headless servers. GPU portability via Metal, DirectX 12, and Vulkanâ€”no CUDA lock-in. Great for laptops, clusters, and CI.

                </CardDescription>
              </CardContent>
            </Card>
          </div>
        </div>
      </section>

      {/* Code Example Section */}
